			[IntPtr]$SectionHeaderPtr = [IntPtr](Add-S1gn3dlntAsUn51gn3d ([Int64]$Info_of_PE.Headers_of_NTPtr) ([System.Runtime.InteropServices.Marshal]::SizeOf([Type]$PC32T_Y_P_E_S.IMAGE_NT_HEADERS32)))
			$Info_of_PE | Add-Member -MemberType NoteProperty -Name SectionHeaderPtr -Value $SectionHeaderPtr
		}
		
		if (($Headers_of_NTInfo.IMAGE_NT_HEADERS.FileHeader.Characteristics -band $PC32_non_variables.IMAGE_FILE_DLL) -eq $PC32_non_variables.IMAGE_FILE_DLL)
		{
			$Info_of_PE | Add-Member -MemberType NoteProperty -Name FileType -Value 'DLL'
		}
		elseif (($Headers_of_NTInfo.IMAGE_NT_HEADERS.FileHeader.Characteristics -band $PC32_non_variables.IMAGE_FILE_EXECUTABLE_IMAGE) -eq $PC32_non_variables.IMAGE_FILE_EXECUTABLE_IMAGE)
		{
			$Info_of_PE | Add-Member -MemberType NoteProperty -Name FileType -Value 'EXE'
		}
		else
